import React from 'react'

function Menu() {
  return (
    <div>
      <a href='/' ><button>Menu</button></a> <br/>
      <a href='/about-us' ><button>About us</button></a> <br/> 
      <a href='/contact-us' ><button>contact us</button></a> 
    </div>
  )
}

export default Menu;
